import React from "react";
import { NavLink } from 'react-router-dom'; 

const Nav = () => {
  return (
    <div>
      <NavLink to="/" subreddit = "s">Home</NavLink>
      <NavLink to="/section/US">US</NavLink>
      <NavLink to="/section/World">World</NavLink>
      <NavLink to="/section/Politics">Politics</NavLink>
      <NavLink to="/section/Business">Business</NavLink>
      <NavLink to="/section/Technology">Technology</NavLink>
      <NavLink to="/section/Sports">Sports</NavLink>
      <NavLink to="/section/Gaming">Gaming</NavLink>
      <NavLink to="/section/Feedback">Feeback</NavLink>
    </div>
  );
};

export default Nav;
